import React from 'react';
import styled from 'styled-components';
import { theme } from '../../../theme';

const Nav = styled.nav`
    background-color: ${(props) => props.theme.light.darker};
    height: 56px;
    width: 100%;
    box-sizing: border-box;
    display: flex;
    justify-content: space-between;
    align-items: center;
`
const Home = styled.button`

`
const Logo = styled.div`
    background-image: url("/petti_color.png");
    background-repeat: no-repeat;
    background-size: contain;
    background-position-x: center;
    background-position-y: center;
    width: 40px;
    height: 40px;
`

function NavBar() {
  return (
      <Nav>
          <Home>
            <Logo></Logo>
            <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 199.97 187.79">
                {/* <defs><style>.cls-1{fill:#e0bd2b;}.cls-2{fill:none;stroke:#000;stroke-miterlimit:10;}.cls-3{fill:#d3599c;}.cls-4{fill:#8e5f1a;}</style></defs> */}
