                <ellipse cx="100" cy="161.23" rx="11.43" ry="6.41"/>
                <path d="M24.4,105.1C24,95,29.56,78.06,32,73.1,35,67.15,55.9,24,55.28,15.6a6.26,6.26,0,0,0-.74-2.34,2.2,2.2,0,0,0-2.95-.78A100.07,100.07,0,0,0,11.1,145.83C21.48,134.05,24.75,114.58,24.4,105.1Z" transform="translate(0 -12.21)"/>
                <path d="M175.57,105.1c.37-10.13-5.16-27-7.63-32C165,67.15,144.07,24,144.69,15.6a6.26,6.26,0,0,1,.74-2.34,2.2,2.2,0,0,1,2.95-.78,100.07,100.07,0,0,1,40.49,133.35C178.49,134.05,175.22,114.58,175.57,105.1Z" transform="translate(0 -12.21)"/>
                <circle cx="126.98" cy="52.47" r="4.79"/>
                <circle cx="73.02" cy="52.47" r="4.79"/>
                <ellipse cx="100" cy="98.39" rx="26.98" ry="12.5"/>
            </svg>
          </Home>

      </Nav>
  )
}

export default NavBar;
